              <Select defaultValue={defaultValue}>
                {lista.map((elemento, index) => (
                  <Option key={index} value={elemento.username}>
                    {elemento.username}
                  </Option>
                ))}
              </Select>
              ;
            </Grid>
            <Grid item xs={8}>
              <Input
                placeholder="Inserisci date"
                variant="soft"
                style={{
                  background: "rgb(0, 76, 134)",
                  color: "rgb(252, 252, 252)",
                }}
              />
            </Grid>

            {/* Pulsanti Sign Up e Sign In */}
            <Grid
              container
              direction="row"
              justifyContent="center"
              alignItems="center"
              spacing={3}
              xs={12}
            >
              <Grid item>
                <Button
                  variant="solid"
                  style={{ background: "rgb(0, 76, 134)" }}
                  onClick={() => {
                    return null;
                  }}
                >
                  Indietro
                </Button>
              </Grid>
              <Grid item>
                <Button
                  variant="solid"
                  style={{ background: "rgb(0, 76, 134)" }}
                  onClick={async () => {
                    return null;
                  }}
                >
                  Aggiungi
                </Button>
              </Grid>
            </Grid>
          </Grid>
        </Container>
      </div>
    </div>
  );
}

export default Modal;
